function what() {
    console.log(arguments);
}


var NAV_HEIGHT = 38,
setupScroll = function setupScroll() {
    var $window = $(window);

    $window.on('scroll', function() {
        if( $window.scrollTop()>0 ) {
            $('body').addClass('jw-slim-mode', 2000);
        } else {
            $('body').removeClass('jw-slim-mode', 2000);
        }
    });
},
$body,
scrollPageTo = function(selector) {
    var $target = $(selector);

    if( $target.length>0 ) {
        $('html, body').animate({
            scrollTop: $(selector).offset().top - NAV_HEIGHT
        },{
            complete: function() {
                $body.scrollspy('refresh');
                console.log('scrollspy refresh');
            }
        }, 700);
    }
},
setupMenu = function setupMenu() {
    $('.nav .jw-item').on('click', function(ev) {
        ev.preventDefault();
        var $e = $(ev.currentTarget);
        scrollPageTo($e.attr('href'));
    });
},
setupScrollSpy = function() {
    $body.scrollspy({
        target:'.navbar',
        offset: NAV_HEIGHT
    });
},
loadImages = function loadImages(imageMap) {
    $.each(imageMap, function(className, src) {
        $('.' + className).attr('src', src);
    });
},
main = function main() {
    $body = $('body');
    loadImages(Images);
    setupScroll();
    setupMenu();
    setupScrollSpy();
};

jQuery(main);

var Images = {
    weather: 'data:image/jpeg;base64,', 
    pomodoro: 'data:image/jpeg;base64,',
    fortunes: 'data:image/jpeg;base64,',
    twitchtv: 'data:image/jpeg;base64,'
}
